import React from 'react'
import CommentItem from './CommItem'

const CommentList = ({ comments }) => {
  return (
    <div>
    <h1>Comments:</h1>
    <div>
        {comments.map((comment, index) =>
            <div key={comment.id}>
                <CommentItem comment={comment} comments={comments}/>
            </div>
        )}

    </div>

</div>
  )
}

export default CommentList
